def battery_level() :

    bat = []

    try :
        level = "unknown"
        level = subprocess.check_output("cd platform-tools & adb shell dumpsys battery | grep level", shell=True, )
        level = level.decode("utf-8")
        level = str(level)
        level = level.replace(" level: ", "")
        level = level.replace("\n", "")
        level = level  + "%"

    except subprocess.CalledProcessError as e:
        level = str("unknown\n")

    if "100%" in level :
        level = "charged"

    if "19" in sdk_level():
        string = ""
        bat.append(level)

        for character in bat :
            if character != "" and character != "\n":
                string +=character
        level = string

    return "Battery : " + level

def manufacturer() :

    try :
        level = "unknown"
        level = subprocess.check_output("cd platform-tools & adb shell getprop ro.product.manufacturer", shell=True, )
        level = level.decode("utf-8")
        level = str(level)
        level = level.replace(" level: ", "")

    except subprocess.CalledProcessError as e:
        level = str("unknown\n")

    if "19" in sdk_level():
        level = level.replace("\n", "")

    return "Manufacturer : " + level

def brand() :

    try :
        brand = subprocess.check_output("cd platform-tools & adb shell getprop ro.product.manufacturer", shell=True, )
        brand = brand.decode("utf-8")
        brand = brand.replace("\n", "")
        brand = str(brand)

    except subprocess.CalledProcessError as e:
        brand = str("unknown\n")

    return brand

def sdk_level() :
    version = "unknown"

    if brand() != "unknown" :

        ver = []

        try :
            version = subprocess.check_output("cd platform-tools & adb shell getprop ro.build.version.sdk", shell=True, )
            version = version.decode("utf-8")
            version = str(version)
            version = version.replace("\n", "")
            ver.append(version)
            version = ver[0]

        except subprocess.CalledProcessError as e:
            version = str("unknown\n")

    return version


def android_version() :

    try :
        version = subprocess.check_output("cd platform-tools & adb shell getprop ro.build.version.release", shell=True, )
        version = version.decode("utf-8")
        version = str(version)

    except subprocess.CalledProcessError as e:
        version = str("unknown\n")

    if "19" in sdk_level():
        version = version.replace("\n", "")

    return "Android version : " + version

def specs() :
    return  manufacturer() + android_version() + device_search() + battery_level()

