def call_status () :
    isCalling = True

    try :
        status = ""
        status = subprocess.check_output("cd platform-tools & adb shell dumpsys telephony.registry | grep mCallState", shell=True, )
        status = status.decode("utf-8")
        status = str(status)
        status = status.replace("    mCallState=", "")
        status = status.replace("\n", "")

        if ("00" in status or status == "0") :
            isCalling = False

    except subprocess.CalledProcessError as e:
        status = str("0")
    


    return isCalling


