def make_call(numero) :
    call = os.system("cd platform-tools & adb shell am start -a android.intent.action.CALL -d tel:%s" % numero)
    call = call_screen("Call Screen", numero)

    status = True
    isCalling = call_status()

    while (status == True) :
        event, values = call.read()

        if isCalling == False :
            call.close()
            status = False

        if event == "bye" :
            hang_up()
            call.close()
            status = False
           

        elif event == sg.WIN_CLOSED:
            hang_up()
            call.close()
            status = False

        

